import { Navbar, Nav, NavDropdown, Form, Button, Container, Image, Row, Col } from "react-bootstrap";
import logo from './img/logo.png';

import { Link } from "react-router-dom";

const HeaderApp = () => {
    return (
        <Container>
            <Row className="custom-topheader">
                <Nav style={{ marginRight: 'auto', justifyContent: 'right' }}>
                    <Nav.Link to="/" style={{ color: 'white' }}>Sign-up</Nav.Link>
                    <Nav.Link to="/post" style={{ color: 'white' }}>Login</Nav.Link>
                </Nav>
            </Row>

            <Row className="custom-topheader">
                <Col className="logo">
                    <Link>
                        <Image src={logo}></Image>
                    </Link>
                </Col>
            </Row>
            
            <Row>
                
            </Row>
        </Container>
    );
}

export default HeaderApp;
